(function(e){
  e(function(){
    e(".tab_content").hide();
    e(".t3").addClass("active").show();
    e(".tab_content:first").show();
    
    e("ul.tabs li").click(function(){
      e("ul.tabs li").removeClass("active");
      e(this).addClass("active");
      e(".tab_content").hide();
      var t=e(this).find("a").attr("href");
      e(t).fadeIn();
      return!1
      });
      
    e(".comboBox1").msDropDown().data("dd");
    var t=0;
    e("#buscar-m").click(function(){
      if(t===0){
        e(".band-desp").css({
          display:"block"
        });
        t=1
      }else{
        e(".band-desp").css({
          display:"none"
        });
        t=0
        }
    });
    var n=e(".sel-inst-cont div.instrumento").size(),r=e(".sel-inst-cont div.instrumento").width(),i=n*10,s=r*n+i;
    e(".sel-inst-cont").width(s);
    e(".sel-inst-cont .instrumento").click(function(){
      e(".filtros-inst-cont").css({
        height:"100%"
      })
    });
    e(".sel-inst-cont .instrumento").hover(function()
    {
      e(".b_cerrar",this).css({
        display:"block"
      })
    },function(){
      e(".b_cerrar",this).css({
        display:"none"
      })
      }
    )
    });
  
  
  e(document).on("click",'[data-stage="thumbs"] img',function(t){
    var n=e(this).data("stage-large");
    e('[data-stage="background"] img').attr("src",n);
    e('[data-stage="thumbs"] img').addClass("active").not(e(this)).removeClass("active");
    return t.preventDefault()
    }
  )
})(jQuery);